BugKu-WEB-滑稽题目
思路直接f12找到处在前端的flag

Flagflag&#123;fd3bb83702ccd6b735a00b6312e5d8d0&#125;

BugKu-WEB-GET题目
思路可以看到网页是php语言
$what=$_GET[&#x27;what&#x27;];echo $what;if($what==&#x27;flag&#x27;)echo &#x27;flag&#123;****&#125;&#x27;;

打开意思就是定义what为GET方法传参的内容，然后打印what，再然后是一个判断，如果what弱等于flag，就打印flag此时只需要在网址后面加上”?what&#x3D;flag”，得到flag

Flagflag&#123;6599ef39ff842b2450685345d2e7e666&#125;

BugKu-WEB-POST题目
思路审计代码发现和上题逻辑一样，只不过需要传输的数据变成了POST，此时需要用到HackBar，把USE POST method打开，在body处输入”what&#x3D;flag”，点击EXECUTE得到flag

